import React, { useCallback, useState } from 'react';
import { login } from '../store/actions/action';
import { register } from '../store/actions/registration';
import { Link } from 'react-router-dom';
import { useDispatch } from 'react-redux';


export default function Account() {
    const dispatch = useDispatch();
    const [logValue, setLogValue] = useState('');
    const [pasValue, setPasValue] = useState('');

    const handleSubmit = useCallback(async (ev) => {
        ev.preventDefault()
        const data = await dispatch(login({
            email: logValue,
            password: pasValue,
        }));
        console.log(data);
    }, [logValue, pasValue]);

    return (
        <>
            <div className='signInPage'>
                <div className="box">
                    <span className="borderLine"></span>
                    <form onSubmit={(ev) => handleSubmit(ev)}>
                        <h2>Sign in</h2>
                        <div className="inputBox">
                            <input value={logValue} onChange={(ev) => setLogValue(ev.target.value)} type="email"
                                required="required" />
                            <span>Login</span>
                            <i />
                        </div>
                        <div className="inputBox password">
                            <input value={pasValue} onChange={(ev) => setPasValue(ev.target.value)} type="password"
                                required="required" />
                            <span>Password</span>
                            <i />
                        </div>
                        <div className="links">
                            <Link to="/register">Sign up</Link>
                        </div>
                        <input type="submit" value="Login" />
                    </form>
                </div>
            </div>
        </>
    )
}
